import './App.css';
import Cards from './components/Cards/Cards.jsx';
import Nav from './components/NavBar/nav';
//aqui
import characters from './data';

function App() {
   return (
      <div className={Style.app}>
         <Nav />
         <Cards characters={characters} />
      </div>
   );
}

export default App;
